import React, { useState } from "react";
import "../css/card.css";

export default function Card({ number }) {
  const [title, setTitle] = useState("Eric");

  return (
    <div>
      <div onClick={() => setTitle("Jenn")} className="card-container">
        {number}
      </div>

      <h1>{title}</h1>
    </div>
  );
}
